CREATE TABLE `msboardgame` (
  `BGID` int(11) PRIMARY KEY,
  `BGName` varchar(255),
  `BGMin_players` int(11),
  `BGMax_players` int(11),
  `BGAvg_time` int(11),
  `BGYear` int(11),
  `BGPrice` int(11)
);

CREATE TABLE `mscustomer` (
  `CustomerID` int(11) PRIMARY KEY,
  `CustomerName` varchar(255),
  `CustomerEmail` varchar(255),
  `CustomerGender` varchar(6)
);

CREATE TABLE `trtransactiondetail` (
  `TransactionID` int(11),
  `BGID` int(11),
  `Qty` int(11),
  PRIMARY KEY (TransactionID, BGID)
);

CREATE TABLE `trtransactionheader` (
  `TransactionID` int(11) PRIMARY KEY,
  `CustomerID` int(11),
  `StaffID` int(11),
  `Date` date
);

CREATE TABLE MsStaff (
	StaffId INT PRIMARY KEY, 
	StaffName VARCHAR(255), 
	StaffEmail VARCHAR(255), 
	StaffGender VARCHAR(255), 
	StaffAddress VARCHAR(255)
);

CREATE TABLE MsBGCategory (
	BGID INT PRIMARY KEY, 
	BGCategoryName VARCHAR(255)
);























































































